import React from "react";

const Header = () => {
  return (
    <div class="header">
      <div class="header_items">
        {" "}
        <a href="#"> Home </a> <a href="#"> Products </a>{" "}
        <a href="#"> About </a> <a href="#"> Help </a>{" "}
      </div>{" "}
      <div> </div>{" "}
      <div>
        <h1> Users </h1>{" "}
        <ul>
          {" "}
          {users.map((user) => (
            <li key={user.id}>
              <Link to={user.id}> {user.name} </Link>{" "}
            </li>
          ))}{" "}
        </ul>{" "}
      </div>{" "}
    </div>
  );
};
export default Header;
